import React from "react";
import "./Navbar.css";
import AnchorLink from "react-anchor-link-smooth-scroll";

const Navbar = () => {
  return (
    <div className="Navbar">
      <ul className="nav-menu" style={{ cursor: "pointer" }}>
        <li> <AnchorLink href="#home">Home  </AnchorLink></li>
        <li> <AnchorLink href="#about">About Me</AnchorLink></li>
        <li> <AnchorLink href="#services">Services</AnchorLink></li>
        <li><AnchorLink href="#portfolio">Portfolio</AnchorLink></li>
        <li><AnchorLink href="#contact">Contact</AnchorLink></li>
      </ul>
      <div className="nav-connect">
        <AnchorLink
          style={{ color: "white", fontSize: "30px", textDecoration: "none" }}
          href="/contact"
        >
          Connect With Me
        </AnchorLink>
      </div>
    </div>
  );
};

export default Navbar;
